import React from 'react';
import styled from 'styled-components';

const StyledSlideFour = styled.div`
  position: relative;
  background: #FFFFFF;
  height: 100vh;
  width: 100vw;

  .left-column {
    background: #FAC943;
    height: 92vh;
    width: 35vw;
    position: absolute;
    bottom: 0;
    left: 75px;

    #car-img {
      height: 30vh;
      position: absolute;
      top: calc(100% / 2 - 15vh);
      right: calc(100% / 2);
    }

    .image-wrapper {
      position: absolute;
      top: 40px;
      right: -100px;
      display: inline-block;
      height: 80vh;

      img {
        height: 100%;
        border: black solid 3px;
        border-radius: 30px;
        box-shadow: -12px 13px 27px -8px rgba(0,0,0,0.77);
      }
    }
  }
`;

function SlideFour() {
  return (
    <StyledSlideFour className="slide-four">
      <div className='left-column'>
        <img id='car-img' src='images/white_car_front.png' alt='white car' />
        <div className='image-wrapper'>
          <img src='images/app_screen_1.png' alt='mobile device with Eleanor app' />
        </div>
      </div>
    </StyledSlideFour>
  );
}

export default SlideFour;
